import Row from 'react-bootstrap/Row';
import WeatherCard from '../../Common/Card/WeatherCard';

function Hour(props) {
    let {
        forecast: {
            forecastday
        }
    } = props.weather;

    let {
        hour: hours
    } =  forecastday[0];

    return (
        hours.map((hour, key)=>{
            return (
                <WeatherCard 
                    time = {hour.time}
                    icon = {hour.weather.icon}
                    temperature = {`${hour.temp_c}&deg;C`}
                />
            )
        })
    )
}

export default Hour;
